import React, { useState, useEffect } from "react";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Navigate,
} from "react-router-dom";
import axios from "axios";
import Home from "./HomePH";
import Loggedin from "./Loggedin";

const App = () => {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  useEffect(() => {
    axios.get("http://localhost:3002").then((res) => {
      if (res.data.valid) {
        setIsLoggedIn(true);
      }
    });
  }, []);

  return (
    <Router>
      <Routes>
        <Route exact path="/">
          {!isLoggedIn ? <Home /> : <Navigate to="/loggedin" />}
        </Route>
        <Route path="/loggedin">
          {isLoggedIn ? <Loggedin /> : <Navigate to="/" />}
        </Route>
      </Routes>
    </Router>
  );
};

export default App;
